import Vue from 'vue';
import Router from 'vue-router';
import UserManager from './views/UserModule/UserManagerment/UserManager';
import PrintFileCodeManager from './views/CodeModule/PrintFileCode/PrintFileCodeManager';
import Area from './views/DictModule/DictManagerment/AreaManager';
import Data from './views/DictModule/DictManagerment/DataManager';
import ReportOutManager from './views/ReportModule/ReportManagerment/OutWareHouseReportManager';
import ReportOutDetail from './views/ReportModule/ReportManagerment/OutWareHouseDemailReportManager';
import ReportInManager from './views/ReportModule/ReportManagerment/InWareHouseReportManager';
import ReportInDetail from './views/ReportModule/ReportManagerment/InWareHouseDemailReportManager';
import ReportAlloManager from './views/ReportModule/ReportManagerment/AllocationReportManager';
import ReportAlloDetail from './views/ReportModule/ReportManagerment/AllocationDemailReportManager';
import MaterialsManager from './views/MatlModule/MaterialsManagerment/MaterialsManager';
import Test from './views/ReportModule/ReportManagerment/test';

import Table from './views/TableModule/Table/Table';
import Custom from './views/TableModule/Table/Custom';

import ShellGlobal from './views/ShellGlobalModule/ShellGlobalCode/ShellGlobal'
import ShellTest from './views/ShellGlobalModule/ShellGlobalCode/ShellTest'


Vue.use(Router);

var router = new Router({
  mode: 'hash',
  routes: [
    {
      path: "/shell-global",
      name: "ShellGlobal",
      meta: { title: "表格功能测试" },
      component: ShellGlobal
    },
    {
      path: "/shell-test",
      name: "ShellTest",
      meta: { title: "表格功能测试" },
      component: ShellTest
    },
    {
      path: "/custom",
      name: "custom",
      meta: { title: "表格功能测试" },
      component: Custom
    },
    {
      path: "/table",
      name: "table",
      meta: { title: "表格功能封装" },
      component: Table
    },
    {
      path: "/test",
      name: "test",
      meta: { title: "测试报表数据" },
      component: Test
    },
    {
      path: '/aaa',
      name: 'UserManager',
      meta: { title: '用户管理2' },
      component: UserManager,
    },

    {
      path: '/PrintFileCodeManager',
      name: 'PrintFileCodeManager',
      meta: { title: '打印数码导入管理' },
      component: PrintFileCodeManager,
    },
    {
      path: "/area",
      name: "area",
      meta: { title: "省市信息" },
      component: Area
    },
    {
      path: "/data",
      name: "data",
      meta: { title: "基础数据" },
      component: Data
    },
    {
      path: "/reportout",
      name: "reportout", mate: { title: "发货报表" }, component: ReportOutManager
    },
    { path: "/reportoutdetail", name: "reportoutdetail", mate: { title: "发货明细报表" }, component: ReportOutDetail },
    { path: "/reportin", name: "reportin", mate: { title: "入库报表" }, component: ReportInManager },
    { path: "/reportindetail", name: "reportindetail", mate: { title: "入库明细报表" }, component: ReportInDetail },
    { path: "/reportallo", name: "reportallocation", mate: { title: "调拨报表" }, component: ReportAlloManager },
    { path: "/reportallodetail", name: "reportallodetail", mate: { title: "调拨明细报表" }, component: ReportAlloDetail },
    { path: "/Materials", name: "Materials", mate: { title: "产品信息" }, component: MaterialsManager },


  ],
});;
router.beforeEach((to, from, next) => {
  /* 路由发生变化修改页面title */
  if (to.meta.title) {
    document.title = to.meta.title
  }
  next();
})


export default router
